INSERT INTO `reviews` VALUES (1,NULL,NULL,'jan 2011 bluescruise','0000-00-00','Fort Lauderdale,FL to the Caribbean','event','2011-03-19','','2011-07-15 05:57:27','0000-00-00','0','steve daniels','Another cruise has come and gone; when is the next one?? As usual the Caribbean version of the LRBC was a blueslover’s heaven. Trip details can be summarized quickly. The msWesterdam of Holland America Lines supported the sterling reputation of the cruise company with its smooth ride, delicious and plentiful food, cheerful and impeccable service, and multiple creature comforts. Weather was almost perfect, and the stops were chosen wisely: San Juan, Puerto Rico; St. Croix, Virgin Islands; and St. Kitts (although I never got off the boat). The folks who organize this week-long party have learned to do it right. The music is the reason to be there, of course. The twenty different acts performed 4 times each during the week, so one could sample every act at least once with ease, or see one’s favorite 4 times! The styles of blues ran the gamut, from the acoustic blues of soloist Paul Oscher, to the Cajun gumbo rock of Tab Benoit and the Wetlands All-Stars, to the blues rock of Jimmy Thackery and Reba Russell, to the seminal Chicago blues of Humbert Sumlin, Henry Gray, and their cohorts from the Howlin’ Wolf band, to the soul blues of Irma Thomas and Shemekia Copeland, to the virtuouso harmonica of Charlie Musselwhite and colleagues....Jam sessions abounded, their spontaneity often constituting the highlight of each day. Pianists David Maxwell, Mitch Woods, and Leon Blue took turns commanding the piano bar late each night, exhibiting their diverse and compelling styles and jamming with whomever showed up, as well as sitting in themselves during the sets of various bands during the day. Every return cruiser has a strategy on a LRBC, whether it be a judicious eating pattern to limit weight gain (or not), a temperate drinking approach (or not), or a sleep tactic (sleep? with outdoor upper deck jam sessions to 3 to 5 AM?). So-called “virgin” (first time) cruisers listen to the advice of returnees, or learn the hard way how to survive and thrive. In terms of the music, the choices include sitting and watching an act for 30 or just 5 minutes, then leaving for a different act, staying for a full 90 minute set, taking a break between acts, going non-stop from noon until 4 AM and collapsing....Life is filled with difficult decisions, all of them leading to satisfaction on this boat. My personal strategy is to check out acts with which I’m unfamiliar on the first couple of days, while fitting in my established favorites; then devoting the last part of the week to repeatedly enjoying the best. Those acts which I didn’t enjoy, and there were a few, will remain unnamed, since 	  	  	  	  taste is subjective, other cruisers loved them, and I don’t want to dis musicians who work hard and love what they do. So...: Tab Benoit and the Wetlands All-Stars: anything that Tab does is fine by me. He is a great singer and guitarist with ample charisma, indisputably one of the best bluesmen around. The band featured fiddle, washboard, and accordion, and it swung! Jimmy Thackery: a guitar god. There is nothing he can’t do, and he does it with a droll, deadpan expression and almost motionless body. One can hear Jimi Hendrix, Roy Buchanan, Stevie Ray Vaughan, Duane Eddy, the Ventures, and Hawaiian guitar influences, but he makes it all his own. Wow! When he sat in with Smokin’ Joe Kubek’s band, the sparks flew; every song got a standing ovation. Too bad that he and Tab never managed to play together on this cruise. Ruthie Foster: a crowd favorite, with terrific stage presence, a sense of humor, sincerity, and a fantastic voice. Shemekia Copeland: another amazing vocalist. Michael Burks: previously unfamiliar to me, he is an unpretentious performer who can really sing, and positively scorches his guitar! Roomful of Blues: This band, now together for 40 years and consistently one of the best in the world, deserves an award for fortitude as well as musical chops. Three days before the cruise sailed, its trumpet player, Bob Enos, was found dead of a heart attack in his hotel room the morning after a show. The band took the stage with sad hearts, and cruisers contributed over $3,500 for Enos’s surviving wife and child. By the way, the leader and guitarist of Roomful, Chris Vachon, follows ably in the footsteps of previous Roomful guitarists Duke Robillard and Ronnie Earl; Vachon is one of the most unrecognized and underrated blues guitarists around. I have only 2 minor cavils about the LRBCs. First, one or two more acoustic acts on each cruise would provide more variety. Second, each act should be asked before the cruise to prepare at least two completely different performance sets, so that seeing one’s favorite musicians 3 or 4 times during the week doesn’t result in seeing 3 or 4 performances of the same playlist. No matter how much one likes a particular act, seeing the same exact set repeatedly gets boring. To review the entire January 2008 line-up, and to preview the line-up for the next cruise, which leaves from San Diego in October 2008, go to the LRBC Web site: www.bluescruise.com. Cabins sell out months ahead of time, so reserve one early if you want to experience a week of blues nirvana. I reap no benefit of any kind by touting the LRBC; I just want you to know that it’s there to be savored. Thanks!  Steve','','images/reviews','blobs','image','header-zaandam.jpg',0,''),(4,NULL,NULL,'Avila Beach Blues Festival','2008-05-28','Avila Beach, CA','event','2011-03-19','','2011-07-15 05:55:48','0000-00-00','0','Barry Keller ES','Under cloudy skies, but mainly not very cold weather, a good crowd showed up for the Memorial-Day-Sunday “15th Avila Beach Blues Festival”. Lineup: Canned Heat, Elvin Bishop, Little Richard. We nabbed a spot next to SLO Blues Society, smack-dab in the middle in the back – great sound and stage view. One SLO woman brought a HULA-HOOP, so in and in front of the “Blues Society” booths became hula-hoop central, attracting many talented, almost exclusively female hula-hoopers. Ya hadda been there!\r\nMusically, Canned Heat did a credible job of recreating its 60s sound, but with only one original member (the drummer) and lacking the persona of the original front man, the late Bob “the BEAR” Hite (a hard-core blues aficionado), it wasn’t quite the same. Elvin Bishop WAS quite the same (thank goodness!), noting for the SLO crowd that “...in Spanish, Obispo means …. BISHOP !” He also said he was excited because he had never heard Little Richard live.\r\n\r\nWell, I hope Elvin dug it, but Little Richard, “the Georgia Peach, the best lookin’ man in show bizness”, seemed almost senile compared to his amazing shows I caught in the early 70s, only singing a few words of about five of his own songs, then letting the (amazing) band actually play them (the band - 5 horns, guitar, bass [his son!], other keyboards, drums). A lot of music-less time and stopping and starting songs, asking the audience if they were feeing good, inviting women onto the stage, shooing them back off, etc. Still, the crowd seemed to dig it and the band really rocked when it got going. Little Richard said he is 76 years old and you have to give him credit for keeping at it.','','images/reviews','blobs away','image','avila.jpg',0,''),(5,'','','jan 2010 2nd event','0000-00-00','','album','2011-03-19','','2011-07-19 23:41:07','0000-00-00','0','0','xxx xxx xxx','','images/reviews','blobs','image','',0,''),(6,NULL,NULL,'event going home','2011-07-14','mars','event','2011-07-22','','2011-07-23 19:40:12','0000-00-00',NULL,'dan hankey','ented, almost exclusively female hula-hoopers. Ya hadda been there! Musically, Canned Heat did a credible job of recreating its 60s sound, but with only one original member (the drummer) and lacking the persona of the original front man, the late Bob “the BEAR” Hite (a hard-core blues aficionado), it wasn’t quite the same. Elvin Bishop WAS quite the same (thank goodness!), noting for the SLO crowd that “...in Spanish, Obispo means …. BISHOP !” He also said he was excited because he had never heard Little Richard live. Well, I hope Elented, almost exclusively female hula-hoopers. Ya hadda been there! Musically, Canned Heat did a credible job of recreating its 60s sound, but with only one original member (the drummer) and lacking the persona of the original front man, the late Bob “the BEAR” Hite (a hard-core blues aficionado), it wasn’t quite the same. Elvin Bishop WAS quite the same (thank goodness!), noting for the SLO crowd that “...in Spanish, Obispo means …. BISHOP !” He also said he was excited because he had never heard Little Richard live. Well, I hope El','','images/reviews','blobs','','comin_home.png',0,''),(7,'Do I move you','Janiva Magness',NULL,NULL,NULL,'album','2011-07-23','','0000-00-00 00:00:00','2011-04-28','Northern Blues Music','Steve Daniels','For the third year in a row, Janiva Magness was nominated for the Blues Foundationï¿½s Blues Music Award as Contemporary Female Artist of the Year. This year, 2006, she won. This album shows us why.\r\n\r\nOriginally from Detroit and now a denizen of Southern California, Magness has been producing quality albums and sterling live shows for years, while remaining just under the radar of widespread blues recognition. \\\"Do I Move You?\\\" admirably showcases her impressive vocal strengths. It features an eclectic selection of songs, 3 of which were composed by her husband, the bass player and multi-instrumentalist Jeff Turmes. The back-up band is stellar throughout, especially the rhythm section.\r\n\r\nThe tunes run a gamut of styles. \\\"I\\\'m Just a Prisoner,ï¿½ the opener, introduces Magnessï¿½s sultry but powerful pipes. The album then segues nicely into Willie Dixonï¿½s ï¿½Workinï¿½ on Me Baby,ï¿½ followed by the diverse stylings of Turmes and songs of Delbert McClinton and Denise LaSalle among others. Magnessï¿½s version of the country blues, ï¿½Donï¿½t Let Your Memories,ï¿½ is revelatory. Her rendition of the Nina Simone title track is spine-tingling (and overcomes one of the worst blues lines ever penned: ï¿½When I touch you, do you quiver/From your head down to your liver?ï¿½). ï¿½Stealinï¿½ Sugarï¿½ and ï¿½A Man Size Jobï¿½ convey a brash erotic sizzle, and can only be termed the best of bedroom blues.\r\n\r\nAt times Magness reminds one of Bonnie Raitt, Susan Tedeschi, and even Bessie Smith, but her voice remains her own. She\\\'s hit the big time now, finally and deservedly.','','images/reviews','blobs','','doimoveyousmall.jpg',0,''),(8,'\\\\','Al Basile',NULL,NULL,NULL,'album','2011-08-03','','2011-08-07 17:53:02','0000-00-00','Sweetspot','Steve Daniels','From the first bars of the first song, we think that we know what to expect of this album: uptempo, horn-driven blues.  Well, it’s that and much more.\r\n	Renaissance man Al Basile has an noteworthy resume.  Educator, poet, singer, songwriter, and ace instrumentalist (cornet), Basile was part of the always-stalwart horn section of the venerable and stellar band Roomful of Blues from 1973-1975.  Since then he has appeared as sideman on many albums, ventured into jazz, collaborated multiple times with guitar maven and Roomful founder Duke Robillard, and produced a number of fine albums of his own.  This, his eighth solo album, is a gem.\r\n	All 13 songs on the CD are penned by Basile, and they represent a spectrum of genres from gospel to quasi-rockabilly to soul to jazz, while maintaining deep roots in the blues. “The Price (I Got to Pay)” kicks off the album with a mid-tempo declaration of artistic independence from a bluesman whose instrument, the cornet, isn’t the usual cynosure of blues music.  “Along Come the Kid” gooses the tempo and allows space for one of the many tasteful solos provided by Robillard, who also produced the album.  It’s followed by one of the highlights of the disc, “Lie Down in Darkness (Raise Up in Light),” a slow gospel song featuring fine piano, a beautiful cornet solo by Basile and then a guitar response by Robillard, and sublime vocal backing by the nonpareil Blind Boys of Alabama.  Why listen more; can it get any better?\r\n	Well, it stays just as good.  “1.843 Million” is a humorous tale of crime gone bad, accompanied by the sounds of the street, an unusual structure of 7-line stanzas, and another crack cornet foray.  “Time Can Wait” is a bittersweet love song with an infectious crescendo 3-note saxophone riff, pulsating bass, and Robillard’s subterranean but essential rhythm guitar foundation; it brought to mind the Rolling Stones‘ “Time Waits for No One” transmogrified to the blues.  Lightening the mood are the next two songs: “I Want to Put It There,” whose R-rated insinuations are obvious but fresh, and “The Itch,” the description of a late night allergic reaction that produced this very song.\r\n	“Mr. Graham Bell” switches to a minor key and is the most classicly structured blues song on the disc, perfect for 2 AM in a seedy bar.  The rhythm interlude of piano, bass, and drums is superb, and segues into an equally classy cornet solo.  By the third verse, Basile’s vocal morphs from dolor and dismay to true anguish; a second album highlight.  “She’s a Taker” is a soul blues about a narcissistic lover, and “Reality Show” laments the contemporary replacement of personal connection with celebrity worship.  “Pealing Bells” is another slow, soul-gospel amalgam, reminiscent of “St. James Infirmary.”  “Don’t Sleep on Santa” is blues with a hint of Latino flavor, open to salacious interpretation, and featuring fine cornet and guitar solos...and blues piccolo!  The disc closes with “Distant Ships,” a poignant lament underpinned by Robillard’s 6-string lyricism, a syncopated drum backing, and a moving cornet bridge.\r\n	The band backing Basile is exemplary.  Doug James on sax, clarinet, and piccolo   provides tasteful support.  Brad Hellen’s bass is propulsive; Mark Texeira on percussion sticks to basic rhythms which are solid but not distractingly flashy; Bruce Bears is fine on piano and organ; and Duke Robillard is masterful as usual without grabbing the spotlight.\r\n	What about Basile’s singing?  Well, I was very impressed.  Lacking the powerful pipes of such luminaries as Little Milton and Curtis Salgado, Basile uses his voice to maximal effect, resulting in presentations wry, moving, and upbeat as befit the song.\r\n	Last but not least, Basile’s brief annotated notes about each song are illuminating and draw attention to the lyrics themselves, which are far superior to the trite renderings of many blues rave-ups, ballads, and dirges; they’re worth reading as the poetry that they are.\r\n	Highly recommended!\r\n\r\n[This review originally appeared on the BluesWax website.]','','images/reviews','blobs','','header-zaandam.jpg',0,''),(10,'','',NULL,NULL,NULL,'album','2011-08-03','','0000-00-00 00:00:00','0000-00-00','','','','','images/reviews','blobs','','',0,''),(11,'','',NULL,NULL,NULL,'album','2011-08-03','','0000-00-00 00:00:00','0000-00-00','','','','','images/reviews','blobs','','',0,''),(12,NULL,NULL,'','0000-00-00','','event','2011-08-03','','0000-00-00 00:00:00','0000-00-00',NULL,'','','','images/reviews','blobs','','',0,''),(13,NULL,NULL,'','0000-00-00','','event','2011-08-03','','0000-00-00 00:00:00','0000-00-00',NULL,'','','','images/reviews','blobs','','',0,''),(14,NULL,NULL,'','0000-00-00','','event','2011-08-03','','0000-00-00 00:00:00','0000-00-00',NULL,'','','','images/reviews','blobs','','',0,''),(15,NULL,NULL,NULL,'0000-00-00',NULL,'newsletter','2011-08-07','','0000-00-00 00:00:00','0000-00-00',NULL,'','','','images/reviews','blobs','','',0,''),(16,NULL,NULL,NULL,'0000-00-00',NULL,'newsletter','2011-08-07','','0000-00-00 00:00:00','0000-00-00',NULL,'','','','images/reviews','blobs','','',0,''),(17,NULL,NULL,NULL,'2011-08-07',NULL,'newsletter','2011-08-07','','2011-08-08 01:28:07','0000-00-00',NULL,'Steve Daniels','If it walks like a duck, and plays a blazing guitar WHILE walking like a duck (and\r\nit’s not Chuck Berry), it must be ........ Robert BILBO Walker!! Plus..... dancing girls!\r\n<p>\r\nOf course, we’re actually talking about “Little Junior Bilbo”, since his dad, back\r\ndown in the Mississippi Delta near legendary Clarksdale, was called Bilbo first!\r\nWhatever, our Bilbo fell in love with the blues when he heard Mississippi local Ike\r\nTurner play. Ike moved to southern California, but Bilbo moved to Bakersfield! He had a\r\nfarm, but kept playing the blues, as well as heading back down south now and again,\r\nincluding a recent rockin’ appearance at New Orleans JAZZ FEST! Now it’s our turn at\r\nthe Santa Barbara Blues Society, with Bilbo’s first visit to our quaint burg.\r\n<p>\r\nDoors will open at 7:00 PM, followed from 7:15 to 7:45 by an opening set by\r\nS.B.’s own Henderson Brothers. Walker will play 2 full sets beginning at 8:00 PM.\r\n(Note the earlier starting times for this show!)\r\n<p>\r\nGRAND FINALE – BLUES CRUISE RAFFLE !! The show will feature the drawing\r\nof the raffle winner of an ocean-view cabin on the sold-out October Legendary Rhythm\r\n& Blues Cruise, the last Pacific blues cruise. Tickets are still available by mail, and will\r\nbe available at the show until intermission...and then the winner will be drawn! It could\r\nbe YOU!!\r\n<p>\r\nThere will be the usual yummy BBQ food snacks and a big dance floor at the\r\nshow! Tickets will be on sale at the door for $30 general admission and $40 preferred\r\nVIP seating. MEMBERS MAY BRING UP TO THREE FRIENDS (or even enemies!)\r\nAT THE MEMBER DISCOUNT OF $5 OFF EACH TICKET ! College students are\r\nadmitted with ID for $15, high school students for $10, and children under 12 are free.\r\n<p>\r\nFor information, advance VIP tickets, or group rates contact: The Santa Barbara Blues\r\nSociety  (805) 722-8155 or “info@sbblues.org”','Real-Deal Mississippi JUKE JOINT Bluesman\r\n\r\n \r\n \r\n Robert “BILBO” Walker\r\n\r\n \r\n headlines Blues Society show\r\n\r\n \r\n \r\n Sat., Sept. 10, 2011, \r\n\r\n \r\n \r\n \r\n Warren Hall\r\n\r\n \r\n Earl Warren Showgrounds','images/reviews','blobs','','',0,''),(18,NULL,NULL,'','0000-00-00','','event','2011-08-07','','0000-00-00 00:00:00','0000-00-00',NULL,'','','','images/reviews','blobs','','',0,''),(19,NULL,NULL,NULL,'0000-00-00',NULL,'newsletter','2011-08-13','','0000-00-00 00:00:00','0000-00-00',NULL,'','','','images/reviews','blobs','','',0,''),(20,'\\\"Strictly Whatever\\\"','Harry Manx & Kevin Breit',NULL,NULL,NULL,'album','2011-10-20','','0000-00-00 00:00:00','0000-00-00','Stony Plain','Steve Daniels','		No great musical tradition is static; almost every genre incorporates ideas from others.  The blues, derived from Africa, has in the last few decades exhibited the influence of different varieties of world music.  Among many others, Taj Mahal and Corey Harris have mined its African roots; Charlie Musselwhite and Lynwood Slim have visited South America for collaboration and inspiration; Taj has been to Hawaii in body and spirit.  Harry Manx, Canadian singer, songwriter, and multi-instrumentalist, has in turn brought the spirit and sounds of South Asia to the blues, after sojourning in India for several years and becoming proficient on the mohan veena.  (What is a mohan veena?\r\nAccording to Wikipedia: The instrument is a modified guitar with 20 strings under very high tension, held in the lap like a steel guitar.)\r\n	However, on this album, eschewing stereotyping as an Indian/blues fusion artist, Manx and his musical maven buddy Kevin Breit present 2 covers and 10 original songs that...well, let me tell you.\r\n	Opening the album is a version of “Sunny,” the Bobby Hebb soul classic made refreshingly new with a lazy, relaxed approach and Manx’s smoky singing, as well as his unattributed harmonica.  It’s followed by a mild surprise, the rocking “Nothing I Can Do,” a Breit composition featuring Breit’s pleasant nasal vocal; if you didn’t know better, you might think that you were listening to Tom Petty and the Heartbreakers.  No, wait, maybe it’s actually Steely Dan: that’s what “Looking for a Brand New World,” the next song, evokes.  On that cut Breit hits the wah-wah pedal vigorously, just one of the many unusual and often ethereal effects he coaxes from his electric guitar.\r\n	“Hippy Trippy,” an instrumental, ups the playful quotient, with Breit handling electric sitar over Manx’s baritone guitar foundation.  What sounds like a calliope apparently is a xylophone.  This tune could be the soundtrack of a silent slapstick comedy movie.\r\n	This is BluesWax, isn’t it?  “Mr. Lucky” confirms that we’re in the correct realm.  These guys can play some fine straight blues when they want to.  (Unaccountably, the liner notes attribute this John Lee Hooker song to Manx.)  A segue into another instrumental, Indian in style with electric guitar synthesizer emulation and harmonica, is then succeeded by my favorite of the album’s tunes, “Do Not Stand at My Grave and Weep,” which is highlighted by Manx’s superb vocal and Breit’s spacey and moving electric guitar solo.\r\n	Time to switch gears again: “Little Ukukele” with Breit on the uke, Manx on lap slide, and a very nice harmony vocal duet.  “There Was a Girl” reprises the duet mode in a song melding a California singer/songwriter vibe with a near-reggae beat.  In “Looking for a Plan” we are back to Manx’s compelling singing, and some succinct and mysterious Dylanesque lyrics.  “Dance with Delilah” has a Hawaiian flavor, with Manx playing the mohan veena and Breit overdubbing acoustic and electric guitars.  The closer, “Carry My Tears Away,” is a poignant reminiscence supported by Breit on mandolin and with still another fine vocal duet. \r\n	The only other musician on the album is Art Avalos, who plays percussion on all  tunes but the last.  Many of the songs feature Manx and Breit overdubbing on two or even three instruments, and the liner notes fail to clarify the exact instrumentation.  In fact, confused even after multiple listenings and a consultation with a musician friend of mine, I resorted to contacting Manx by e-mail in order to learn that there is no bass on the album -- it’s Manx on baritone guitar -- that Manx plays drums with his feet, and that Manx contributes harmonica and Breit contributes xylophone (and whistling!) without any liner note mention at all.\r\n	Well, as the title says, whatever.  Expert, eclectic, and exotic.  This is no traditional blues album, but it features a couple of traditionally constructed blues tunes, expert musicianship,  and, throughout, a devotion to the emotional commitment of the blues...and a sense of fun as well.  You won’t dance to it, but you will appreciate it and find it both moving and joyful.\r\n	\r\n	[Thanks to Michael Spota for consultation.]\r\n\r\n  \r\n	\r\n	','','images/reviews','blobs','','',0,'');
